import Head from "next/head";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <div style={{ height: "100%" }}>
    <Head>
      <link rel="stylesheet" href="/static/main.css" />
    </Head>
    <Header />
    {props.children}
    <Footer />
  </div>
);

export default Layout;
